@CaulfieldTim @joeschwarcz @McGillOSS I believe in modern medicine. I get vaccinated, and I see a doctor.

However, when I am sick, I use ginger, onions, etc and it seems to help. I have a sore throat, and a carrot ginger drink with lots of ginger seems to help.

If it get worse I will see a doctor. Balance is key.

@Jack_Septic_Eye Must have been practicing,
"Top of mornin' my name is Jacksepticeye!"
But try some honey in your tea is natural remedy for sore throat.

@etcesona Get better soon Etce!!! 🍓✌️👍🤒🤒
Try drinking some Tea, because that always helps me! Add some honey to it to help smooth the sore throat! 

Hope this helps!

@SOFFru1 Here’s how it goes:
Doc: do you own a gun? Are you depressed? Are you thinking about hurting yourself or anyone else?
Me: no (lie). No. No. I have a sore throat, so can we get on with it.

@ipwnallyou You know that sore throat I told you about that was super weird?

Well it brought it's friends head and body aches along with it, turns out they were just really late to the party. 

but yes I'm fine nowhere near as bad as last time. yet.

